import React, { Component } from 'react'
import { Navbar } from 'react-bootstrap';
import './App.css'

class App extends Component {

    render() {
        return (<div>
            <Navbar/>
            
                <h>Hello,World</h>
            </div>
           
        )
    }

}
export default App;
